import React from 'react'
import useReactRouter from 'use-react-router';
import Header from './header';
import HeaderChat from './headerChat';
const scenarioLeft = require('../assets/scenarioLeft.png');
const scenarioRight = require('../assets/scenarioRight.png');

const Summary: React.FC = () => {
    const { history } = useReactRouter();
    return (
        <div>
            <HeaderChat title="サマリ画面"/>
            <div></div>
            <img src={scenarioLeft} />あなたがたどったシナリオは結婚シナリオ
            <img src={scenarioRight} />
            <input type="textarea">
            </input>
            <div></div>
            <button onClick={()=>history.push("/welcome")}>旅行終了</button>
        </div>
    )
}
export default Summary
